cific post.'=>'Kiam vi kontrolas la kapablon %s, vi ĉiam devas kontroli ĝin kontraŭ specifa afiŝo.','Your object cache implementation does not support flushing individual groups.'=>'Via efektivigo de la objekta kaŝmemoro ne subtenas forflugi individuajn grupojn.','Your object cache implementation does not support flushing the in-memory runtime cache.'=>'Via objekta kaŝmemoro-efektivigo ne subtenas purigadon de la enmemora rultempa kaŝmemoro.','Deleted author: %s'=>'Forigita aŭtoro: %s','Template for %s'=>'Ŝablono por %s','Not found: %1$s (%2$s)'=>'Ne trovita: %1$s (%2$s)','Block pattern categoryFooters'=>'Piedoj','Cron unschedule event error for hook: %1$s, Error code: %2$s, Error message: %3$s, Data: %4$s'=>'Eraro pri malprograma evento de Cron por hoko: %1$s, Erarkodo: %2$s, Erarmesaĝo: %3$s, Datumoj: %4$s','Cron reschedule event error for hook: %1$s, Error code: %2$s, Error message: %3$s, Data: %4$s'=>'Cron-reprograma evento-eraro por hoko: %1$s, Erarkodo: %2$s, Erarmesaĝo: %3$s, Datumoj: %4$s','Whether a theme uses block-based templates.'=>'Ĉu etoso uzas blok-bazitajn ŝablonojn.','The ID of the page that should display the latest posts'=>'La ID de la paĝo, kiu devus montri la lastajn afiŝojn','The ID of the page that should be displayed on the front page'=>'La ID de la paĝo kiu devus esti montrata sur la ĉefpaĝo','What to show on the front page'=>'Kion montri sur la ĉefpaĝo','File %1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'Dosiero %1$s estas <strong>malrekomendita</strong> ekde versio %2$s sen alternativo disponebla.','File %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'Dosiero %1$s estas <strong>malrekomendita</strong> ekde la versio %2$s! Uzu %3$s anstataŭe.','Function %1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'Funkcio %1$s estas <strong>malrekomendita</strong> ekde versio %2$s sen alternativo disponebla.','Function %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'Funkcio %1$s estas <strong>malrekomendita</strong> ekde la versio %2$s! Uzu %3$s anstataŭe.','block descriptionDisplays the link of a post, page, or any other content-type.'=>'Montras la ligilon de afiŝo, paĝo aŭ ajna alia enhavo-speco.','block titleRead More'=>'Ekscii pli','block descriptionContains the block elements used to render content when no query results are found.'=>'Enhavas la blokelementojn uzatajn por bildigi enhavon kiam neniuj serĉrezultoj estas trovitaj.','block titleNo results'=>'Neniu rezulto','block descriptionDisplay post author details such as name, avatar, and bio.'=>'Montri detalojn pri afiŝo-aŭtoro kiel nomo, avataro kaj biografio.','block descriptionThe author biography.'=>'Biografio de la aŭtoro.','block titleAuthor Biography'=>'Biografio de la aŭtoro de la afiŝo.','block descriptionCreate a link that always points to the homepage of the site. Usually not necessary if there is already a site title link present in the header.'=>'Kreu ligilon, kiu ĉiam montras al la hejmpaĝo de la retejo. Kutime ne necesas, se jam ĉeestas retliga titolo en la kaplinio.','block titleHome Link'=>'Hejma Ligilo','block descriptionGather blocks in a layout container.'=>'Kolektu blokojn en aranĝa ujo.','block descriptionDisplays a title with the number of comments.'=>'Montras titolon kun la nombro da komentoj','block titleComments Title'=>'Komenta titolo','block descriptionAn advanced block that allows displaying post comments using different visual configurations.'=>'Altnivela bloko kiu permesas montri afiŝojn komentojn uzante malsamajn vidajn agordojn.','block descriptionDisplays a paginated navigation to next/previous set of comments, when applicable.'=>'Montras paĝigitan navigadon al sekva/antaŭa aro de komentoj, kiam aplikebla.','block titleComments Pagination'=>'Paĝigo de komento','block descriptionDisplays the previous comment\'s page link.'=>'Montras la paĝan ligilon de la antaŭa komento.