WordPress has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'Saluton!

WordPress havas enkonstruitan funkcion, kiu detektas kiam kromaĵo aŭ temo kaŭzas mortigan eraron en via retejo, kaj sciigas vin per ĉi tiu aŭtomata retpoŝto.

###CAUSE###

Unue, vizitu vian retejon (###SITEURL###) kaj kontrolu ĉu videblas iu evidenta problemo. Poste, rigardu la paĝon, kie la ilo detektis la eraron (###PAGEURL###) kaj serĉu problemon tie.

###SUPPORT###

Se via retejo rompiĝis kaj ne eblas atingi vian panelon kiel kutime, WordPress nun havas novan "restarigan reĝimon". Per tio, vi povas sekure ensaluti al via panelo kaj plu provi malkovri la problemon.

###LINK###

Por pli sekurigi vian retejon, tiu ĉi ligilo eksvalidiĝos post ###EXPIRES###. Sed ne zorgu, nova ligilo sendiĝos al vi se la eraro reokazos denove.

Kiam vi petas helpon pri la problemo, eble vi estos petata doni kelkajn el la sekvaj informoj:
