uter. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Alklaku al &#8220;Aldoni novan bildon&#8221; por alŝuti bildan dosieron de via komputilo. Via etoso funkcias plej bone kun bildo kiu havas kapo-grandon de %s bilderoj &#8212; post la alŝuto vi povos stuci la bildon por konformigi ĝin. ','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Alklaku al &#8220;Aldoni novan bildon&#8221; por alŝuti bildan dosieron de via komputilo. Via etoso funkcias plej bone kun bildo kiu kongruas kun la grando de via filmeto &#8212; post la alŝuto vi povos stuci la bildon por konformigi ĝin. ','Meridian'=>'Meridiano','%1$s-%2$s'=>'%1$s-%2$s','Minute'=>'Minuto','Hour'=>'Horo','Day'=>'Tago','Time'=>'Horo','Month'=>'Monato','Date'=>'Dato','Usage of user levels is deprecated. Use capabilities instead.'=>'Uzo de uzant-niveloj estas nun evitinda. Anstataŭe, uzu kapablojn.','Name for the Visual editor tabVisual'=>'Pervida','Create New Menu'=>'Krei novan menuon','New Menu'=>'Nova menuo','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'Se via etoso havas lokon por kromprogrametoj, vi povas ankaŭ aldoni menuojn tie. Vizitu la <a href="%s">kromprogrametan panelon</a> kaj aldonu &#8220;kromprogrameton de naviga menuo&#8221; por aperigi menuon en flankpanelo aŭ piedo.','The theme defines itself as its parent theme. Please check the %s header.'=>'La etoso difinas sin kiel sian propran patron. Kontrolu la kapon de %s.','If your theme has multiple menus, giving them clear names will help you manage them.'=>'Se via etoso havas plurajn menuojn, dono de klaraj nomo